You can also add more style rules to the NativeBase 2.0 components by adding your own style rules to the theme file of that component (provided for each component). The default NativeBase 2.0 component style should be at the bottom of the style object. This style will always be applied as a base style. After that any theme style will be merged with the style, i.e., the theme style rules will override the base component rules. In the end, any style specified through the style prop directly on the component will be merged on top of the styles mentioned above to get the final component style.
Rules above the default component style are the new rule types that are specific to theme styles.
These style objects in the theme for any components can be applied to them as a property.
